import React, { Component } from 'react';
import PropTypes from 'prop-types';

import {
  Modal,
  ModalHeader,
  ModalContent,
  ModalFooter,
  Button,
  Select,
  Field,
  Text,
  Title
} from 'shipnow-mercurio';

import {
  Level,
  LevelLeft,
  LevelRight,
  Column,
  Columns
} from 'bloomer'

import { faTimes } from "@fortawesome/free-solid-svg-icons";
import FontAwesomeIcon from "@fortawesome/react-fontawesome";

class ServiceCreationModal extends Component {
  constructor(props) {
    super(props);

    this.handleClose = this.handleClose.bind(this);
  }

  handleClose() {
    this.props.onClose && this.props.onClose();
  }

  render() {
    return(
      <Modal show>
        <ModalHeader>
          <Level>
            <LevelLeft>
              <Title>Nuevo servicio</Title>
            </LevelLeft>
            <LevelRight>
              <Button icon="plus" kind="link" size="xl" onClick={ this.handleClose }>
              <FontAwesomeIcon icon={ faTimes }/>
            </Button>
            </LevelRight>
          </Level>
        </ModalHeader>
        <ModalContent>
        </ModalContent>
        <ModalFooter>
        </ModalFooter>
      </Modal>)
  }
}

ServiceCreationModal.PropTypes = {
  onSave: PropTypes.func,
  onClose: PropTypes.func,
}

ServiceCreationModal.defaultProps ={
  onSave: null,
  onClose: null,
}

export default ServiceCreationModal;
